

L.TileLayer.FHMap = L.TileLayer.extend({
  _loadTile: function (tile, tilePoint) {
    tile._layer  = this;
    tile.onload  = this._tileOnLoad;
    tile.onerror = this._tileOnError;

    this._adjustTilePoint(tilePoint);
    // debugger;
    // //Debug static map img
    // setTimeout(function(){
    //   tile.src="data:image/png;base64,";
    // },100);
  setTimeout(function(){
    fhmap.getMapTile({
      "x": tilePoint.x,
      "y":tilePoint.y,
      "zoom":tilePoint.z
    },function(err,res){
      tile.src=res.base64Img;
      tile.width=256;
    });
  },0);
    

    this.fire('tileloadstart', {
      tile: tile,
      url: tile.src
    });
  }

});
L.fhMap=function( options){
  return new L.TileLayer.FHMap("",options);
}
